import React from 'react';
import styled from 'styled-components';

const AboutContainer = styled.div`
  max-width: 800px;
  margin: 0 auto;
  padding: 2rem;
  text-align: center;
`;

const Title = styled.h2`
  font-size: 2.5rem;
  color: #2c3e50;
  margin-bottom: 2rem;
`;

const Description = styled.p`
  font-size: 1.2rem;
  line-height: 1.6;
  color: #34495e;
  margin-bottom: 1.5rem;
`;

const AboutMe = () => {
  return (
    <AboutContainer>
      <Title>About Me</Title>
      <Description>
        Hello! I'm Calvin Salsali, a passionate software engineering student with a 
        keen interest in building innovative solutions. I love exploring new technologies 
        and creating efficient, user-friendly applications.
      </Description>
      <Description>
        My focus areas include web development, software architecture, and creating 
        scalable solutions. I'm constantly learning and expanding my skillset to stay 
        current with modern development practices.
      </Description>
    </AboutContainer>
  );
};

export default AboutMe;
